"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?2/14/2278/abstract/1\">",
"      Sachdeva M, Kaur S, Nagpal M, Dewan SP. Cutaneous lesions in new born. Indian J Dermatol Venereol Leprol 2002; 68:334.",
"     </a>",
