"     Robert Fox, MD, PhD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?2/14/2282/contributors\">",
"     Paul Creamer, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
