" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Medical risk factors for heat illness in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Increased fluid losses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        GI or renal losses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Gastrointestinal illness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Diabetes mellitus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Diabetes insipidus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Dehydration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Insensible losses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Burns",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Febrile illness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Increased sweating",
"       </td>",
"      </tr>",
"      <tr>",
