"        Cystic fibrosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Congenital heart disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Impaired heat dissipation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ectodermal dysplasia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hyperthyroidism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Spinal cord lesions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Impaired thirst mechanism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Young children",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
