"        Environmental risk factors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        High heat index",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Poor preparation (lack of heat acclimitization, inadequate prehydration, lack of sleep or rest, or poor fitness)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Excessive physical exertion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Insufficient rehydration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Clothing or equipment that causes excessive heat retention",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Other or multiple mechanisms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Obesity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Prescribed medications*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Drug abuse",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Juvenile hyperthyroidism (Grave disease)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Prepubescent age",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sickle cell disease and&nbsp;sickle cell trait&nbsp;",
"       </td>",
"      </tr>",
