"       </li>",
"       <li>",
"        Policy Statement - Climatic heat stress and exercising children and adolescents. American Academy of Pediatrics. Committee on Sports Medicine and Fitness and Council on School Health. Pediatrics 2011; 128: e741.",
"       </li>",
